function Formulario() {
    return (
        <form>
            <input type="text" placeholder="Data de Inicio" />
            <input type="text" placeholder="Data de Fim" />
            <input type="text" placeholder="Nome operador transacionado" />

            <input className="" type="button" value="Pesquisar" />
        </form>
    )
}

export default Formulario;
